import React from 'react';
import { useState, useEffect } from 'react';

const App = () => {
  const [count, setCount] = useState(0);
  useEffect(() => {
    setTimeout(() => {
      setCount(() => count+1);
    }, 1000)
  });
  return (
    <h2> {`Count : ${count}`} </h2>
  );
};

export default App;
